static void
gcChipPatch19(
    __GLcontext *gc,
    __GLprogramObject *progObj,
    const gctCHAR **patchedSrcs,
    gctINT* index
    )
{
    gcUNIFORM unit2;
    gcATTRIBUTE texcoord0;
    gcSHADER shader = gcvNULL;
    gceSTATUS status = gcvSTATUS_OK;
    __GLshaderObject *fragShaderObj = progObj->programInfo.attachedShader[__GLSL_STAGE_FS];
    gctUINT32_PTR compilerVersion = gcvNULL;

    gcmHEADER_ARG("gc=0x%x progObj=0x%x index=%d", gc, progObj, index);

    gcmONERROR(gcSHADER_Construct(gcSHADER_TYPE_FRAGMENT, &shader));

    gcmONERROR(gcSHADER_GetCompilerVersion(fragShaderObj->shaderInfo.hBinary, &compilerVersion));
    gcmONERROR(gcSHADER_SetCompilerVersion(shader, compilerVersion));

    gcmONERROR(gcSHADER_AddAttribute(shader, "out_texcoord0", gcSHADER_FLOAT_X2, 1, gcvTRUE, gcSHADER_SHADER_DEFAULT, gcSHADER_PRECISION_MEDIUM, &texcoord0));
    gcmONERROR(gcSHADER_AddUniform(shader, "texture_unit2", gcSHADER_SAMPLER_2D, 1, gcSHADER_PRECISION_LOW, &unit2));
    gcmONERROR(gcSHADER_AddOpcode(shader, gcSL_TEXLD, 1, gcSL_ENABLE_X, gcSL_FLOAT, gcSHADER_PRECISION_LOW, 0));
    gcmONERROR(gcSHADER_AddSourceUniform(shader, unit2, gcSL_SWIZZLE_XYZW, 0));
    gcmONERROR(gcSHADER_AddSourceAttribute(shader, texcoord0, gcSL_SWIZZLE_XYYY, 0));
    gcmONERROR(gcSHADER_AddOpcodeConditional(shader, gcSL_KILL, gcSL_LESS, 0, 0));
    gcmONERROR(gcSHADER_AddSource(shader, gcSL_TEMP, 1, gcSL_SWIZZLE_XXXX, gcSL_FLOAT, gcSHADER_PRECISION_LOW));
    gcmONERROR(gcSHADER_AddSourceConstant(shader, 0.5));
    gcmONERROR(gcSHADER_AddOutput(shader, "#Color", gcSHADER_FLOAT_X4, 1, 1, gcSHADER_PRECISION_MEDIUM));
    gcmONERROR(gcSHADER_Pack(shader));

OnError:
    if (gcmIS_SUCCESS(status))
    {
        gcmVERIFY_OK(gcSHADER_Destroy(fragShaderObj->shaderInfo.hBinary));
        fragShaderObj->shaderInfo.hBinary = shader;
    }
    else if (shader)
    {
        gcmVERIFY_OK(gcSHADER_Destroy(shader));
    }

    gcmFOOTER();
}

static void
gcChipPatch20(
    __GLcontext *gc,
    __GLprogramObject *progObj,
    const gctCHAR **patchedSrcs,
    gctINT* index
    )
{
    GLuint i;
    GLuint activeUnit = gc->state.texture.activeTexIndex;
    __GLtextureObject *savedTexture;

    /* Save the current texture object. */
    savedTexture = gc->texture.units[activeUnit].boundTextures[__GL_TEXTURE_CUBEMAP_INDEX];

    /* Walk all hash entries. */
    if (gc->texture.shared->linearTable)
    {
        for (i = 0; i < gc->texture.shared->linearTableSize; i++)
        {
            __GLtextureObject *texObj = (__GLtextureObject*)gc->texture.shared->linearTable[i];

            /* Check if this object is a cube map not attached to any frame buffer and the texture object is known. */
            if (   (texObj != gcvNULL)
                && (texObj->targetIndex == __GL_TEXTURE_CUBEMAP_INDEX)
                && (texObj->fboList == gcvNULL)
               )
            {
                __GLchipTextureInfo *texInfo = (__GLchipTextureInfo*)texObj->privateData;
                gcoTEXTURE texture = (texInfo != gcvNULL) ? texInfo->object : gcvNULL;

                if (texture != gcvNULL)
                {
                    gcoSURF surface;
                    gctSIZE_T offset;

                    /* Try getting last face of next mipmap level. */
                    if (gcmIS_ERROR(gcoTEXTURE_GetMipMapFace(texture, 1, gcvFACE_NEGATIVE_Z, &surface, &offset)))
                    {
                        /* Set the texture object. */
                        gc->texture.units[activeUnit].boundTextures[__GL_TEXTURE_CUBEMAP_INDEX] = texObj;

                        /* Generate mipmaps. */
                        glGenerateMipmap(GL_TEXTURE_CUBE_MAP);
                    }
                }
            }
        }
    }

    /* Restore the texture object. */
    gc->texture.units[activeUnit].boundTextures[__GL_TEXTURE_CUBEMAP_INDEX] = savedTexture;
}

