static gctCONST_STRING
gcChipUtilFindString(
    gctBOOL Encrypted,
    gctCONST_STRING String,
    gctCONST_STRING Search,
    gctINT_PTR SearchIndex
    )
{
    gctCONST_STRING source;
    gctINT          sourceIndex;
    gctCONST_STRING search;
    gctUINT8        key = Encrypted ? 0xFF : 0x00;

    gcmHEADER_ARG("Encrypted=%d, String=%s Search=%p SearchIndex=0x%x",
                  Encrypted, String, Search, SearchIndex);

    /* Start from the beginning of the source string. */
    source = String;

    /* Reset search index. */
    sourceIndex = 0;
    search      = Search;

    /* Loop until the end of the source string. */
    while (source[sourceIndex] != '\0')
    {
        gctCHAR ch = *search ^ key;

        /* Check if we match the current search character. */
        if (source[sourceIndex] == ch)
        {
            /* Increment the source index. */
            sourceIndex ++;

            if (Encrypted)
            {
                if ((*search ^ key) == 0)
                {
                    key ^= 0xFF;
                }
                key ^= ch;
            }

            /* Increment the search index and test for end of string. */
            if (*++search == '\0')
            {
                /* Return the current index. */
                *SearchIndex = sourceIndex;

                /* Return the location of the search string. */
                gcmFOOTER_ARG("return=%s", source);
                return source;
            }
        }

        /* Skip any white space in the source string. */
        else if ((source[sourceIndex] == ' ')  ||
                 (source[sourceIndex] == '\t') ||
                 (source[sourceIndex] == '\r') ||
                 (source[sourceIndex] == '\n') ||
                 (source[sourceIndex] == '\\'))
        {
            if (sourceIndex == 0)
            {
                /* Increment the source. */
                source++;
            }
            else
            {
                /* Increment the source index. */
                sourceIndex++;
            }
        }

        /* No match. */
        else
        {
            /* Next source character. */
            source++;

            /* Reset search index. */
            sourceIndex = 0;
            search      = Search;
            key         = Encrypted ? 0xFF : 0x00;
        }
    }

    /* No match. */
    gcmFOOTER_ARG("return=%s",gcvNULL);
    return gcvNULL;
}

static GLint
gcChipPatchUI(
    __GLcontext *gc,
    gctBOOL UI
    )
{
    __GLchipContext *chipCtx = CHIP_CTXINFO(gc);
    gceSTATUS status = gcvSTATUS_OK;
    gcsSURF_VIEW rtViews[__GL_MAX_DRAW_BUFFERS], depthView;
    gcsSURF_VIEW nullView = {gcvNULL, 0, 1};
    GLboolean yInverted = GL_FALSE;
    gctUINT samples = 1;
    __GLchipDirty *chipDirty = &chipCtx->chipDirty;
    GLuint i;

    gcmHEADER_ARG("gc=0x%x UI=%d", gc, UI);

    for (i = 0; i < gc->constants.shaderCaps.maxDrawBuffers; ++i)
    {
        /* Init rtViews array to nullView first: dView now is nullView */
        rtViews[i] = nullView;
    }

    if (UI)
    {
        gcoSURF_GetSamples((gcoSURF)gc->drawablePrivate->rtHandles[0], &samples);
        if ((chipCtx->patchInfo.uiDepth == gcvNULL) &&
            (gc->frameBuffer.drawFramebufObj == &gc->frameBuffer.defaultDrawFBO) &&        /* No FBO is bound. */
            (samples > 1) &&          /* MultiSampled. */
            (gc->bufferObject.generalBindingPoint[__GL_ARRAY_BUFFER_INDEX].boundBufObj != gcvNULL) && /* A VBO is bound. */
            (gc->bufferObject.generalBindingPoint[__GL_ARRAY_BUFFER_INDEX].boundBufObj->usage == GL_DYNAMIC_DRAW)   /* And the VBO usage is GL_DYNAMIC_DRAW. */
            )
        {
            gcsSURF_VIEW rtView = {(gcoSURF)gc->drawablePrivate->rtHandles[0], 0 ,1};
            gcsSURF_VIEW uiView = {(gcoSURF)chipCtx->patchInfo.uiSurface , 0 ,1};

            gcmONERROR(gcoSURF_ResolveRect(&rtView, &uiView, gcvNULL));

            /* Reset the draw and depth target. */
            gcmONERROR(gco3D_UnsetTarget(chipCtx->engine, 0, (gcoSURF)gc->drawablePrivate->rtHandles[0]));
            gcmONERROR(gco3D_UnsetTarget(chipCtx->engine, 0, (gcoSURF)gc->drawablePrivate->depthHandle));
            /* Context->framebufferChanged = GL_TRUE; */  /* ? Notify changes: need to do the actual calls later in the if. */

            /* Save current read buffer. */
            chipCtx->patchInfo.uiRead = (gcoSURF)gc->readablePrivate->rtHandles[0];

            /* Swap the UI surface into the current draw surface. */
            gcmONERROR(gcoSURF_Swap((gcoSURF)gc->drawablePrivate->rtHandles[0], chipCtx->patchInfo.uiSurface));
            gc->readablePrivate->rtHandles[0] = gc->drawablePrivate->rtHandles[0];

             /* Force dirty, since the surface pointers do not change. */
            chipDirty->uBuffer.sBuffer.rtSurfDirty = GL_TRUE;

            /* Remove depth buffer. */
            chipCtx->patchInfo.uiDepth       = (gcoSURF)gc->drawablePrivate->depthHandle;
            gc->drawablePrivate->depthHandle = gcvNULL;

            /* Apply the changes. */
            rtViews[0].surf = (gcoSURF)gc->drawablePrivate->rtHandles[0];

            yInverted = gcoSURF_QueryFlags(rtViews[0].surf, gcvSURF_FLAG_CONTENT_YINVERTED);

            gcmONERROR(gcoSURF_GetSamples(rtViews[0].surf, &samples));
            gcmONERROR(gcChipSetDrawBuffers(gc, 0, 0, rtViews, &nullView, &nullView, yInverted, samples, GL_FALSE, 0, 0, GL_FALSE, 1));

            rtViews[0].surf = (gcoSURF)gc->readablePrivate->rtHandles[0];

            yInverted = gcoSURF_QueryFlags(rtViews[0].surf, gcvSURF_FLAG_CONTENT_YINVERTED);

            gcmONERROR(gcChipSetReadBuffers(gc, 0, &rtViews[0], &nullView, &nullView, yInverted, GL_FALSE));

            /* Validate render buffer again for patch change it */
            gcChipValidateRenderTargetState(gc, chipCtx);
        }
    }
    else
    {
        /* Here's the "Restore" Path. */
        if (chipCtx->patchInfo.uiDepth != gcvNULL)
        {
            /* Reset the draw and depth target. */
            gcmONERROR(gco3D_UnsetTarget(chipCtx->engine, 0, (gcoSURF)gc->drawablePrivate->rtHandles[0]));
            /* Context->framebufferChanged = gcvTRUE; */  /* ? Notify changes. */

            /* Swap the UI surface out of the current draw surface. */
            gcmONERROR(gcoSURF_Swap((gcoSURF)gc->drawablePrivate->rtHandles[0], chipCtx->patchInfo.uiSurface));

            /* Re-enable the depth buffer. */
            gc->drawablePrivate->depthHandle = chipCtx->patchInfo.uiDepth;
            chipCtx->patchInfo.uiDepth = gcvNULL;

            /* Force dirty, since the surface pointers do not change. */
            chipDirty->uBuffer.sBuffer.rtSurfDirty = GL_TRUE;

            /* Restore the read buffer. */
            gc->readablePrivate->rtHandles[0] = chipCtx->patchInfo.uiRead;

            rtViews[0].surf = (gcoSURF)gc->drawablePrivate->rtHandles[0];

            yInverted = gcoSURF_QueryFlags(rtViews[0].surf, gcvSURF_FLAG_CONTENT_YINVERTED);

            depthView.surf = (gcoSURF)gc->drawablePrivate->depthHandle;
            depthView.firstSlice = 0;
            depthView.numSlices = 1;
            gcmONERROR(gcoSURF_GetSamples(rtViews[0].surf, &samples));
            gcmONERROR(gcChipSetDrawBuffers(gc, 0, 0, rtViews, &depthView, &nullView, yInverted, samples, GL_FALSE, 0, 0, GL_FALSE, 1));

            rtViews[0].surf = (gcoSURF)gc->readablePrivate->rtHandles[0];

            yInverted = gcoSURF_QueryFlags(rtViews[0].surf, gcvSURF_FLAG_CONTENT_YINVERTED);

            gcmONERROR(gcChipSetReadBuffers(gc, 0, &rtViews[0], &nullView, &nullView, yInverted, GL_FALSE));

            /* Validate render buffer again for patch change it */
            gcChipValidateRenderTargetState(gc, chipCtx);
        }
    }

OnError:
    gcmFOOTER();
    return glmTRANSLATEHALSTATUS(status);
}

void
gcChipGetPatchConditionTb(
    __GLcontext *gc
    )
{
    __GLchipContext *chipCtx = CHIP_CTXINFO(gc);
    gctUINT i;


    for (i = 0; i < gcmCOUNTOF(gcChipPatches); ++i)
    {
        if ((gctUINT)(gcChipPatches[i].patchNum) != i)
        {
            __GLES_PRINT("ERROR: please define correct patchNum, it should be the same with i.\n");
            return;
        }
        chipCtx->doPatchCondition[i] = GL_TRUE;
    }

    chipCtx->doPatchCondition[GC_CHIP_PATCH_LAST] = GL_FALSE;

    if (!(chipCtx->patchId == gcvPATCH_A8HP))
    {
        chipCtx->doPatchCondition[GC_CHIP_PATCH_A8_REPLACE] = GL_FALSE;
    }

    if (!(chipCtx->patchId == gcvPATCH_GTFES30) ||
         !(chipCtx->chipFeature.haltiLevel < __GL_CHIP_HALTI_LEVEL_3))
    {
        chipCtx->doPatchCondition[GC_CHIP_PATCH_GTF_INTVARYING] = GL_FALSE;
    }

    if (!(chipCtx->patchId == gcvPATCH_CKZOMBIES2))
    {
        chipCtx->doPatchCondition[GC_CHIP_PATCH_CKZOMBIES2] = GL_FALSE;
    }

    if (!(chipCtx->patchId == gcvPATCH_CTS_TEXTUREVIEW))
    {
        chipCtx->doPatchCondition[GC_CHIP_PATCH_ANDROID_CTS_TEXTUREVIEW_REPLACE] = GL_FALSE;
    }

    if (!(chipCtx->patchId == gcvPATCH_A8CN))
    {
        chipCtx->doPatchCondition[GC_CHIP_PATCH_A8_REMOVE] = GL_FALSE;
    }

    if (!(chipCtx->patchId == gcvPATCH_SIEGECRAFT))
    {
        chipCtx->doPatchCondition[GC_CHIP_PATCH_SIEGECRAFT] = GL_FALSE;
    }

    if (!(chipCtx->patchId == gcvPATCH_FISHNOODLE || chipCtx->patchId == gcvPATCH_GFXBENCH) ||
        (chipCtx->chipModel == gcv400 && chipCtx->chipRevision >= 0x4645))
    {
        chipCtx->doPatchCondition[GC_CHIP_PATCH_GFXBENCH30] = GL_FALSE;
        chipCtx->doPatchCondition[GC_CHIP_PATCH_GFXBENCH30_2] = GL_FALSE;
    }

    if (chipCtx->chipFeature.hwFeature.hasBugFixes18)
    {
        chipCtx->doPatchCondition[GC_CHIP_PATCH_GTF_DISCARDDRAW] = GL_FALSE;
    }

    if (!(chipCtx->patchId == gcvPATCH_DEQP || chipCtx->patchId == gcvPATCH_GTFES30) ||
        chipCtx->chipFeature.hwFeature.hasCubeBorderLOD)
    {
        chipCtx->doPatchCondition[GC_CHIP_PATCH_USER_CUBE_LOD] = GL_FALSE;
        chipCtx->doPatchCondition[GC_CHIP_PATCH_USER_CUBE_LOD_BIAS] = GL_FALSE;
    }

    if (!(chipCtx->patchId == gcvPATCH_GTFES30) ||
        chipCtx->chipFeature.haltiLevel >= __GL_CHIP_HALTI_LEVEL_2)
    {
        chipCtx->doPatchCondition[GC_CHIP_PATCH_VS_FLOATTEX_GTF] = GL_FALSE;
        chipCtx->doPatchCondition[GC_CHIP_PATCH_VS_INTTEX_GTF] = GL_FALSE;
        chipCtx->doPatchCondition[GC_CHIP_PATCH_VS_UINTTEX_GTF] = GL_FALSE;
        chipCtx->doPatchCondition[GC_CHIP_PATCH_MAX_UBO_SIZE] = GL_FALSE;
    }

    if (!chipCtx->chipFeature.hwFeature.hasTxFrac6Bit ||
        chipCtx->chipFeature.hwFeature.hasTxFrac8Bit)
    {
        chipCtx->doPatchCondition[GC_CHIP_PATCH_NETFLIX_1] = GL_FALSE;
    }

    if ((chipCtx->patchId != gcvPATCH_DEQP &&
        chipCtx->patchId != gcvPATCH_GTFES30) ||
        chipCtx->chipFeature.hwFeature.hasMSAAOQFix)
    {
        chipCtx->doPatchCondition[GC_CHIP_PATCH_DEQP_MSAA_OQ] = GL_FALSE;
    }

    if (!(chipCtx->patchId == gcvPATCH_DEQP || chipCtx->patchId == gcvPATCH_GTFES30) ||
        chipCtx->chipFeature.hwFeature.hasWideLineHelperFix)
    {
        chipCtx->doPatchCondition[GC_CHIP_PATCH_DEQP_HELPER_INVOCATION_DFDX] = GL_FALSE;
        chipCtx->doPatchCondition[GC_CHIP_PATCH_DEQP_HELPER_INVOCATION_DFDX] = GL_FALSE;
        chipCtx->doPatchCondition[GC_CHIP_PATCH_DEQP_HELPER_INVOCATION_FWIDTH] = GL_FALSE;
    }

    if (!(chipCtx->patchId == gcvPATCH_DEQP || chipCtx->patchId == gcvPATCH_GTFES30) ||
        !chipCtx->chipFeature.hwFeature.needWideLineTriangleEMU)
    {
        chipCtx->doPatchCondition[GC_CHIP_PATCH_DEQP_WIDELINE_ES2] = GL_FALSE;
        chipCtx->doPatchCondition[GC_CHIP_PATCH_DEQP_WIDELINE_ES3] = GL_FALSE;
    }

    if (!(chipCtx->patchId == gcvPATCH_DEQP || chipCtx->patchId == gcvPATCH_GTFES30) ||
        !chipCtx->chipFeature.hwFeature.txLerpLessBit)
    {
        chipCtx->doPatchCondition[GC_CHIP_PATCH_DEQP_WIDELERPFIX] = GL_FALSE;
    }

    if (!(chipCtx->patchId == gcvPATCH_DEQP || chipCtx->patchId == gcvPATCH_GTFES30) ||
        !(chipCtx->chipModel == gcv600 && chipCtx->chipRevision == 0x4653) ||
        chipCtx->chipFeature.hwFeature.hasTxSwizzle)
    {
        chipCtx->doPatchCondition[GC_CHIP_PATCH_DEQP_DEPTHCOMPONENT_ES2] = GL_FALSE;
    }

    if (!((chipCtx->patchId == gcvPATCH_SKIA_SKQP) && (chipCtx->chipModel == gcv600 && chipCtx->chipRevision == 0x4653)))
    {
        chipCtx->doPatchCondition[GC_CHIP_PATCH_SKQP_R8] = GL_FALSE;
        chipCtx->doPatchCondition[GC_CHIP_PATCH_SKQP_CUT_SHADER_INSTRUCTION_1] = GL_FALSE;
        chipCtx->doPatchCondition[GC_CHIP_PATCH_SKQP_CUT_SHADER_INSTRUCTION_2] = GL_FALSE;
    }

    if(!((chipCtx->patchId == gcvPATCH_ANDROID_PHOTOS) && (chipCtx->chipModel == gcv600 && chipCtx->chipRevision == 0x4653)))
    {
        chipCtx->doPatchCondition[GC_CHIP_PATCH_GOOGLEPHOTO_IMX8MM] = GL_FALSE;
    }

    return;
}

